async function asyncHtml() {
    let hydrateAllData = []

    for (var i = data.length; i--;) {
        const element = data[i];
        const hydrateData = await getEntityInfo({
            id: {
                id: element.entityId,
                entityType: element.entityType
            }
        }, 1)
        hydrateAllData = [...hydrateAllData, {
            ...hydrateData,
            data: element
        }]
    }



    const lastRelations = hydrateAllData.filter((el) =>
        !el.haveParentNode)
    const restRelations = hydrateAllData.filter((el) =>
        el.haveParentNode)
    // console.log("Relations=>", lastRelations,
        // restRelations)

    let organizedRelations = []

    for (var i = 0; i < lastRelations.length; i++) {
        let relationChild = lastRelations[i]
        let isNotLastChild = true
        let organizedRelation = [relationChild]

        do {
            const child = restRelations.find((el) => el
                .parentNode.some((parent) => parent
                    .from.id === relationChild.data
                    .entityId))


            if (child) {
                organizedRelation = [...
                    organizedRelation, child
                ]
                relationChild = child
                isNotLastChild = true
            } else {
                isNotLastChild = false
            }

        } while (isNotLastChild);
        organizedRelations = [...organizedRelations,
            organizedRelation
        ]
    }



    const machine = data.find((el) => {
        return el['entityType'] ===
            'DEVICE';
    });

    const client = data.find((el) => {
