    //   <p class="mat-small" ><b>Organigrama cliente:</b> ${onlyRelationNameCustomer}</p>


function getEntityInfo(node, level) {
    return new Promise((res, rej) => {
        ctx.rxjs
            .forkJoin([
                entityRelationService
                .findInfoByFrom(node.id),
                entityRelationService
                .findInfoByTo(node.id),
            ])
            .subscribe((dataEntity) => {
                const relationInfo = dataEntity[
                    1].filter(
                    (relation) => relation
                    .from.entityType !=
                    'USER'
                );




                res({
                    haveParentNode: !!
                        relationInfo
                        .length,
                    parentNode: relationInfo,
                    level: level,
                });
            });
    });
};

function isJson(text) {
    try {
        JSON.parse(text);
    } catch (err) {
        return false;
    }
    return true;
}

