        return new Date(data[0]).getDay() == value
    })

    const prevDay = allDataValue.data.filter((data) => {
        const compare = (
            value - 1 == -1 ? 6 : value + 1)
        return new Date(data[0]).getDay() == compare
    })

    let firtsElement = {
        accHours: 0,
        prevState: false,
        prevTime: 0
    }
    let isBeforeDay = false
    // console.log("DatePrevDay>", prevDay)
    const lastDataValue = dataValue[dataValue.length - 1]
    if(!lastDataValue) return convertMsToHM(0)
    const lastDay = new Date(lastDataValue[0])
    let endOfDay = localStartOfDate(lastDay.getFullYear(),
        lastDay.getMonth(), lastDay.getDate() + 1) - 1

    if (prevDay.length) {
        isBeforeDay = prevDay[prevDay.length - 1][0] <
            dataValue[0][0]
        const dateBefore = new Date(dataValue[dataValue.length - 1][0])

        const startOfDate = localStartOfDate(dateBefore
            .getFullYear(), dateBefore.getMonth(),
            dateBefore.getDate())

        firtsElement = isBeforeDay ? {
            accHours: 0,
            prevState: prevDay[prevDay.length - 1][1],
            prevTime: startOfDate
        } : firtsElement
    }

    dataValue = [...dataValue, [endOfDay, lastDataValue[1]]]

    const lengtData = dataValue.length;
    // console.log("DateFirts&End=>", new Date(dataUtilization
    //     .data[0][0]), new Date(dataUtilization.data[
    //     lengtData - 1][0]))
    accData = dataValue.reduce((acc, curr,
        ind) => {
        //firts call
        if (ind == 0 && !isBeforeDay) {
            // console.log("FirtsCall=>", acc, curr,
            //     ind)
            return {
                accHours: 0,
                prevState: curr[1],
                prevTime: curr[0]
            }
        }

        //last call
        if (ind == lengtData - 1) {
            const accHours = acc.accHours + (acc
                .prevState === 'ON' ? curr[0] -
                acc
                .prevTime : 0)
            return {
                accHours: accHours,
                prevState: curr[1],
                prevTime: curr[0]
            }
        }

        if (curr[1] === 'ON') {
            return {
                accHours: acc.accHours,
                prevState: curr[1],
                prevTime: acc
                    .prevState === 'ON' ? acc
                    .prevTime : curr[0]
            }
        }


        const accHours = acc.accHours + (acc
            .prevState === 'ON' ? curr[0] - acc
            .prevTime : 0)

        return {
            accHours: accHours,
            prevState: curr[1],
            prevTime: curr[0]
        }


    }, firtsElement)
    // console.log("Value=>", accData)
    return accData ? convertMsToHM(accData.accHours) : value
    /* code */
} catch (e) {
    console.log("Error6=>", e)
     return convertMsToHM(0)
}

const MS_PER_SECOND = 1000,
    MS_PER_MINUTE = 60 * MS_PER_SECOND,
    MS_PER_HOUR = 60 * MS_PER_MINUTE,
    MS_PER_400_YEARS = (365 * 400 + 97) * 24 * MS_PER_HOUR;

function localStartOfDate(y, m, d) {
    // the date constructor remaps years 0-99 to 1900-1999
    if (y < 100 && y >= 0) {
        // preserve leap years using a full 400 year cycle, then reset
        return new Date(y + 400, m, d) - MS_PER_400_YEARS;
    } else {
        return new Date(y, m, d).valueOf();
    }
}

function padTo2Digits(num) {
    return num.toString().padStart(2, '0');
}

function convertMsToHM(milliseconds) {
    let seconds = Math.floor(milliseconds / 1000);
    let minutes = Math.floor(seconds / 60);
    let hours = Math.floor(minutes / 60);

    seconds = seconds % 60;
    // 👇️ if seconds are greater than 30, round minutes up (optional)
    // minutes = seconds >= 30 ? minutes + 1 : minutes;

    minutes = minutes % 60;

    // 👇️ If you don't want to roll hours over, e.g. 24 to 00
    // 👇️ comment (or remove) the line below
    // commenting next line gets you `24:00:00` instead of `00:00:00`
    // or `36:15:31` instead of `12:15:31`, etc.

    //   hours = hours % 24;

    return `${padTo2Digits(hours)}:${padTo2Digits(minutes)}:${padTo2Digits(seconds)}`;
}

