function countChildren(node) {
    try {
        /* code */
        if(!node.children) return 0
  
        let count = node.children.filter(n=>!n.isFolder).length;
    
      // Recorrer cada hijo y sumar el conteo de sus hijos recursivamente
        for (const child of node.children) {
            count += countChildren(child);
         }
        
        return count;
    } catch (e) {
        return 0
    }
  
}

